	add("antagonist", "{\"term\":\"antagonist\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Latin \u0027antagonista\u0027 from Ancient greek (to 1453) \u0027sc\u003dpolytonic|ἀνταγωνιστής\u0027 (opponent) (\u0027ἀντί\u0027 (against) + \u0027ἀγωνιστής\u0027 (a combatant, pleader, actor) , from \u0027sc\u003dpolytonic|ἀνταγωνίζεσθαι\u0027 (antagonize)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An opponent or enemy\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Milto\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"antagonist\u0027\u0027 of Heaven\u0027s Almighty Kin\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Hooke\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"our \u0027\u0027antagonists\u0027\u0027 in these controversie\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"One who antagonizes or stirs\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A chemical that binds to a receptor but does not produce a physiological response, blocking the action of agonist chemicals\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2001\u0027\u0027: The calcium \u0027\u0027antagonists\u0027\u0027 represent one of the top ten classes of prescription drugs in terms of commercial value, with worldwide sales of nearly $10 billion in 1999. — Leslie Iversen, \u0027Drugs: A Very Short Introduction\u0027 (Oxford 2001, p. 41\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"The main character or force opposing the protagonist in a literary work or drama\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A muscle that acts in opposition to another\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A flexor, which bends a part, is the \u0027\u0027antagonist\u0027\u0027 of an extensor, which extends it\", \"priority\":11}]}, \"synonyms\":{}}");

