	add("antenna", "{\"term\":\"antenna\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027antenna\u0027 nautical term for \u0027yard\u0027 and common term for \u0027pole\u0027, of uncertain origin, but possibly from Proto-indo-european {{m|ine-pro|*temp-||to stretch, extend}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A feeler organ on the head of an insect, crab, or other animal\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An apparatus to receive or transmit radio waves and convert respectively to or from an electrical signal\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The faculty of intuitive astuteness\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027 Kelly Pyrek, \u0027Forensic Nursing\u0027, page 5, ISBN 084933540X\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Most nurses believe they are born with an \u0027\u0027antenna\u0027\u0027 of sorts, which is able to guide them through clinical practice and help them determine what is right and what is not\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027 Mary Lou Decostérd, \u0027Right Brain/Left Brain President: Barack Obama\u0027s Uncommon Leadership Ability\u0027, page 106, ISBN 0313380724\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Obama is astute. He approaches things with the help of a sensitive \u0027\u0027antenna\", \"priority\":7}]}, \"synonyms\":{}}");

