	add("antepenultime", "{\"term\":\"antepenultime\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"English\", \"Latin\"], \"text\":\"First attested in 1860; from the Latin \u0027antepaenultima\u0027 (antepenult) a feminine substantive of \u0027antepaenultimus\u0027 (antepenultimate)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"1860\u0027\u0027, I.J.G. Scheller [aut.] and George Walker [tr.], \u0027A Copious Latin Grammar\u0027 (1825), in: Leonhard Tafel and Rudolph L. Tafel, \u0027Latin Pronunciation and the Latin Alphabet\u0027, \u0026lt;span class\u003d\u0026quot;plainlinks\u0026quot;\u0026gt;[http://books.google.co.uk/books?id\u003dco9EAAAAcAAJ\u0026amp;pg\u003dPA142\u0026amp;dq\u003d%22antepenultime%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d_DVBT9HyMYXF0QXAuq2PDw\u0026amp;ved\u003d0CEYQ6AEwA\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22antepenultime%22\u0026amp;f\u003dfalse page 142]\u0026lt;/span\u0026gt\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"In polysyllables the penultime is accented if the syllable be long, but in all other cases the accent is laid upon the \u0027\u0027antepenultime\u0027\u0027\u0026lt;!-- spelt “antepenultima” in the original source quoted --\u0026gt\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Ukrainian Academy of Arts and Sciences in the United States, \u0027Annals\u0027 XXI:xlix–l, \u0026lt;span class\u003d\u0026quot;plainlinks\u0026quot;\u0026gt;[http://books.google.co.uk/books?id\u003dzi4nAQAAIAAJ\u0026amp;q\u003d%22antepenultime%22\u0026amp;dq\u003d%22antepenultime%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dCkNBT6ekMuG_0QWfztSPDw\u0026amp;ved\u003d0CDwQ6AEwAQ page 104]\u0026lt;/span\u0026gt\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"In surnames from words extended with diminutive suffixes…where the stress is always on the \u0027\u0027antepenultime\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"position\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1986\u0027\u0027, w:Stephen Stephen Adolphe Wurm [ed.], \u0027Papers from the Fourth International Conference on Austronesian Linguistics\u0027 II, \u0026lt;span class\u003d\u0026quot;plainlinks\u0026quot;\u0026gt;[http://books.google.co.uk/books?id\u003d-X0OAAAAYAAJ\u0026amp;q\u003d%22antepenultime%22\u0026amp;dq\u003d%22antepenultime%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dQUBBT9yRO4WmhAfinKjsBQ\u0026amp;ved\u003d0CDwQ6AEwAQ page 114]\u0026lt;/span\u0026gt\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"In \u0027\u0027antepenultime\u0027\u0027 the non-neutral vowels /a/, /i/, /u/ alternate with the neutral shorter /ə/, and the neutral vowel in \u0027\u0027antepenultime\u0027\u0027 and penultime alternates with zero\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Any thing occurring as the antepenultimate in a\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, \u0027Sociobiology\u0027 XLIV:i, \u0026lt;span class\u003d\u0026quot;plainlinks\u0026quot;\u0026gt;[http://books.google.co.uk/books?id\u003dXRdOAAAAYAAJ\u0026amp;q\u003d%22antepenultime%22\u0026amp;dq\u003d%22antepenultime%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dCkNBT6ekMuG_0QWfztSPDw\u0026amp;ved\u003d0CEcQ6AEwAw page 328]\u0026lt;/span\u0026gt\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Mandibles with 4 teeth decreasing in size from the apical teeth, the \u0027\u0027antepenultime\u0027\u0027 (subbasal) smallest\", \"priority\":11}]}, \"synonyms\":{}}");

