	add("anthem", "{\"term\":\"anthem\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\", \"ancient greek (to 1453)\"], \"text\":\"From Middle english (1100-1500) \u0027anteme\u0027 from Old english (ca. 450-1100) \u0027antefn\u0027 from \u0027antiphōna\u0027 from Ancient greek (to 1453) \u0027ἀντίφωνα\u0027 from \u0027ἀντί\u0027 (over against) + \u0027φωνή\u0027 (voice, sound) Compare \u0027antiphon\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Antiphon\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A choral or vocal composition, often with a religious or political lyric\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The school\u0027s \u0027\u0027anthem\u0027\u0027 sang of its many outstanding qualities, and it was hard to keep a straight face while singing\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A hymn of praise or loyalty. \u0026lt;!-- not entirely sure what the difference between defs is --\u0026gt\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The choir sang a selection of Christmas \u0027\u0027anthems\u0027\u0027 at the service just before the big day\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A very popular song or track\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, Peter Buckley, \u0027The rough guide to rock\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"In May 2000, they even finally cracked the UK top ten when they teamed up with Paul Van Dyk on the trance \u0027\u0027anthem\u0027\u0027 \u0026quot;The Riddle\u0026quot\", \"priority\":8}]}, \"synonyms\":{}}");

