	add("anthill", "{\"term\":\"anthill\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\"], \"text\":\"From Middle english (1100-1500) \u0027ametehul\u0027 from Old english (ca. 450-1100) {{m|ang|ǣmethyll||anthill}}, equivalent to {{compound|ant|hill|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A cone-shaped formation constructed from sediment and other available materials by ants or termites. The colony nests underneath this cone\", \"priority\":1}]}, \"synonyms\":{}}");

	add("anthimeria", "{\"term\":\"anthimeria\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"Based on Ancient greek (to 1453) \u0027ἀντί\u0027 + \u0027μέρος\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The use of a word from one word class or part of speech as if it were from another. Typically, and for example, the use of a noun as if it were a verb\", \"priority\":1}]}, \"synonyms\":{}}");

