	add("anthology", "{\"term\":\"anthology\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027ἀνθολογία\u0027 (flower-gathering) from \u0027ἀνθολογέω\u0027 (i gather flowers) from \u0027ἄνθος\u0027 (flower) + \u0027λέγω\u0027 (i gather, pick up, collect) coined by {{w|Meleager of Gadara}} circa 60 BCE, originally as Στέφανος (\u0027στέφανος\u0027 (garland) to describe a collection of poetry, later retitled anthology – see {{w|Greek Anthology}}. \u0027Anthologiai\u0027 were collections of small Greek poems and epigrams, because in Greek culture the flower symbolized the finer sentiments that only poetry can express.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A collection of literary works, such as poems or short stories\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An assortment of things\", \"priority\":2}]}, \"synonyms\":{}}");

	add("anthomania", "{\"term\":\"anthomania\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027ἄνθος\u0027 (flower) {suffix||mania|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An extravagant passion for flowers\", \"priority\":1}]}, \"synonyms\":{}}");

	add("anthomaniac", "{\"term\":\"anthomaniac\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Someone who suffers from anthomania\", \"priority\":1}]}, \"synonyms\":{}}");

	add("anthony", "{\"term\":\"anthony\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"etruscan\", \"Latin\"], \"text\":\"From Latin \u0027antonius\u0027 name of a Roman gens (with excrescent -h- suggested by an unetymological assoication with Greek \u0027ἄνθος\u0027 (flower) . The Roman clan name is of uncertain etymology, but is not Greek or Hebrew; most likely of Etruscan origin.The reference to \u0026quot;Antonius\u0026quot;—\u0027swineherd patron\u0027 and to \u0027pigs\u0027 is especially noteworthy in [http://www.etymonline.com/index.php?term\u003dAnthony Anthony] from the [http://www.etymonline.com \u0026quot;Online Etymology Dictionary\u0026quot;]: \u0026lt;br /\u0026gt;: \u0026quot;[...] St. Anthony (4c.), Egyptian hermit, patron saint of swineherds, to whom one of each litter was usually vowed, hence Anthony for \u0026quot;smallest pig of the litter (1660s; in condensed form tantony pig from 1590s)[...]\u0026quot;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"in regular use since the Middle Ages\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1922\u0027\u0027 , \u0027The Beautiful and Damned\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"quot;...Think you\u0027ve got the best name I\u0027ve heard,\u0026quot; she was saying. - - \u0026quot;\u0027\u0027Anthony\u0027\u0027 Patch. Only you ought to look sort of like a horse, with a long narrow face - and you ought to be in tatters.\u0026quot; \u0026quot;That\u0027s the Patch part though. How should \u0027\u0027Anthony\u0027\u0027 look?\u0026quot; \u0026quot;You look like \u0027\u0027Anthony\u0027\u0027,\u0026quot; she assured him seriously - he thought she had scarcely seen him - \u0026quot;rather majestic,\u0026quot; she continued, \u0026quot; and solemn.\u0026quot\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1952\u0027\u0027 Thomas Pyles, \u0027Words and Ways of American English\u0027, Random House, page 245\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"It is doubtless true that American English lacks a tradition for the pronunciation of \u0027\u0027\u0027Anthony\u0027\u0027\u0027, a name which was not often bestowed upon American males until the comparatively recent craze for supposedly swank \u0026quot;British\u0026quot; Christian names, like \u0027Stephen\u0027, \u0027Peter\u0027, \u0027Michael\u0027, etc., in this country\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1955\u0027\u0027 , \u0027Catch-22\u0027, Chapter Five\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"She was built like a dream and wore a chain around her neck with a medal of Saint \u0027\u0027Anthony\u0027\u0027 hanging down inside the most beautiful bosom I never saw. \u0026quot;It must be a terrible temptation for Saint \u0027\u0027Anthony\u0027\u0027,\u0026quot; I joked - just to put her at ease, you know. \u0026quot;Saint \u0027\u0027Anthony\u0027\u0027?\u0026quot; her husband said. \u0026quot;Who\u0027s Saint \u0027\u0027Anthony\u0027\u0027?\u0026quot\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A city in Kansa\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A city in New Mexic\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A town in Texas\", \"priority\":10}]}, \"synonyms\":{}}");

	add("anthood", "{\"term\":\"anthood\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|ant|hood|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state or essence of being an ant\", \"priority\":1}]}, \"synonyms\":{}}");

	add("anthozoan", "{\"term\":\"anthozoan\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|Anthozoa|an|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A marine invertebrate of the class Anthozoa, such as a sea anemone or cora\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2001\u0027\u0027, translating WG Sebald, \u0027Austerlitz\u0027, Penguin 2011, p. 126\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"In his childhood, he said, he used to walk beside the chalk cliffs of Devon and Cornwall, […] admiring the endless diversity of the semi-sentient marvels oscillating between the vegetable, animal and mineral kingdoms, the zooids and corallines, sea anemones, sea fans and sea feathers, the \u0027\u0027anthozoans\u0027\u0027 and crustaceans over which the tide washed twice a day […\", \"priority\":3}]}, \"synonyms\":{}}");

	add("anthracosis", "{\"term\":\"anthracosis\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A relatively mild pneumoconiosis caused by inhalation of coal\", \"priority\":1}]}, \"synonyms\":{}}");

	add("anthracothere", "{\"term\":\"anthracothere\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|anthraco|there|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of several extinct artiodactyl ungulates, of the family \u0027Anthracotheriidae\u0027, related to the hippopotamus\", \"priority\":1}]}, \"synonyms\":{}}");

	add("anthraquinone", "{\"term\":\"anthraquinone\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|anthra|quinone|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A tricyclic quinone, derived from anthracene\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Any derivative of this parent compound, mostly natural pigments or synthetic dyes\", \"priority\":2}]}, \"synonyms\":{}}");

	add("anthrax", "{\"term\":\"anthrax\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027ἄνθραξ\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An acute infectious bacterial disease of herbivores, especially sheep and cattle. It can occur in humans through contact with infected animals, tissue from infected animals, or high concentrations of anthrax spores, but is not usually spread between humans. Symptoms include lesions on the skin or in the lungs, and it is often fatal\", \"priority\":1}]}, \"synonyms\":{}}");

	add("anthroconservatism", "{\"term\":\"anthroconservatism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|anthro|conservatism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A right-wing ideology that stresses the role of human nature in conservative principles\", \"priority\":1}]}, \"synonyms\":{}}");

	add("anthropization", "{\"term\":\"anthropization\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|anthropo|ization|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the transformation or adaptation of the environment to meet the needs of humans, or by human activity\", \"priority\":1}]}, \"synonyms\":{}}");

	add("anthropobiology", "{\"term\":\"anthropobiology\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|anthropo|biology|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"bioanthropology\", \"priority\":1}]}, \"synonyms\":{}}");

	add("anthropochore", "{\"term\":\"anthropochore\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|anthropo|chore|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A species that depends on anthropochory as a routine means of reproductive dispersal\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A population of a species in a region where it does not natively occur, established by anthropochorous events in the past\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"G. W. Frankie\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Although most anthropochores undoubtedly have been transported by man from the Old World to the New, there is evidence that at least some now known from Europe first became known from the United States and were carried east.\u0026lt;ref name\u003d\u0026quot;FrankieKoehler1983\u0026quot;\u0026gt;G. W. Frankie \u0026amp; Carlton S. Koehler. Urban entomology, interdisciplinary perspectives. Pub: Praeger. isbn: 978-0-03-057572-3\u0026lt;/ref\u0026gt\", \"priority\":4}]}, \"synonyms\":{}}");

	add("anthropochory", "{\"term\":\"anthropochory\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{confix|anthropo|chory|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The (typically inadvertent) dispersal of seeds, spores, or other reproductive botanical material, or of reproductively capable animals, by humans as a routine means of reproductive dispersal of that species\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The (typically inadvertent and sporadic) dispersal by humans, of seeds, spores, or other reproductive botanical material, or of reproductively capable animals, into a region where they do not natively occur, resulting in adventitious anthropochorous establishment of an alien population if successful\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Paul F. Hendrix\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Stephenson stressed the importance of anthropochory in earthworm dispersal. Human introductions, either intentional or unconscious, play a key role in earthworm invasions, as is well demonstrated by the presence of European Lumbricidae in North America, Asia, New Zealand...\u0026lt;ref name\u003d\u0026quot;Hendrix2008\u0026quot;\u0026gt;Paul F. Hendrix. Biological Invasions Belowground: Earthworms as Invasive Species. Springer. isbn: 978-1-4020-5429-7\u0026lt;/ref\u0026gt\", \"priority\":4}]}, \"synonyms\":{}}");

	add("anthropogenesis", "{\"term\":\"anthropogenesis\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|anthropo|genesis|lang\u003den}}, attested in English 1862, replacing or used alongside earlier \u0027anthropogeny\u0027 earlier use in German \u0027anthropogenesis\u0027 and French \u0027anthropogénésie\u0027 (alongside \u0027anthropogénie\u0027 , from the 1820s.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The origin of man\", \"priority\":1}]}, \"synonyms\":{}}");

	add("anthropogenetics", "{\"term\":\"anthropogenetics\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The study of the origins and development of human beings, and human genetics also\", \"priority\":1}]}, \"synonyms\":{}}");

	add("anthropogeography", "{\"term\":\"anthropogeography\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|anthropo|geography|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The study of the geographical distribution of humankind and the relationship between human beings and their environment\", \"priority\":1}]}, \"synonyms\":{}}");

	add("anthropography", "{\"term\":\"anthropography\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"Ancient greek (to 1453) human being + \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The branch of anthropology that deals with the actual distribution of the human race in its different divisions, as distinguished by physical character, language, institutions, and customs, in contradistinction to ethnography, which deals historically with the origin and filiation of races and nations\", \"priority\":1}]}, \"synonyms\":{}}");

	add("anthropolatry", "{\"term\":\"anthropolatry\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"Ancient greek (to 1453)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The worship of a man or men\", \"priority\":1}]}, \"synonyms\":{}}");

	add("anthropolinguistics", "{\"term\":\"anthropolinguistics\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"anthropological linguistics\", \"priority\":1}]}, \"synonyms\":{}}");

	add("anthropologist", "{\"term\":\"anthropologist\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who is versed in anthropology.\u0026lt;!-- material copied from Webster\u0027s Revised Unabridged Dictionary (1913) --\u0026gt\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"In actual fact, it is hard to see how anyone could defend the \u0027prescriptive\u0027 approach. In any other field of enquiry, it would be seen as patently absurd. What would we say of the social \u0027\u0027anthropologist\u0027\u0027 who, instead of describing the way a given society is, sets about prescribing the way he thinks it ought to be? (We\u0027d probably suggest he ought to give up Anthropology and take up Politics\", \"priority\":2}]}, \"synonyms\":{}}");

	add("anthropology", "{\"term\":\"anthropology\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From {{prefix|anthropo|lang\u003den}}, from Ancient greek (to 1453) \u0027ἄνθρωπος\u0027 (man, mankind, human, humanity) {{suffix||logy|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The holistic scientific and social study of humanity, mainly using ethnography as its method\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"According to \u0027\u0027anthropology\u0027\u0027, there are six basic patterns of kinship terminology (i.e., \u0026quot;kin naming systems\u0026quot;): Sudanese, Hawaiian, Eskimo, Crow, Omaha, and Iroquois\", \"priority\":2}]}, \"synonyms\":{}}");

	add("anthropomancy", "{\"term\":\"anthropomancy\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"Ancient greek (to 1453) \u0027ἄνθρωπος\u0027 (man, mankind, human, humanity) + \u0027μαντεία\u0027 (divination)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"divination by the interpretation of human sacrificial entrails\", \"priority\":1}]}, \"synonyms\":{}}");

	add("anthropometer", "{\"term\":\"anthropometer\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|anthropo|meter|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A device used in anthropometry to measure parts of the body\", \"priority\":1}]}, \"synonyms\":{}}");

	add("anthropometrism", "{\"term\":\"anthropometrism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The philosophical doctrine founded on the principle of Protagoras that man (humanity) is the measure of all things\", \"priority\":1}]}, \"synonyms\":{}}");

	add("anthropometry", "{\"term\":\"anthropometry\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"ancient greek (to 1453)\"], \"text\":\"1839, as {{confix|anthropo|t1\u003dhuman|metry|t2\u003dmeasurement|lang\u003den}}, from French {{m|fr|anthropométrie}}, from {{m|fr|anthropo-}} + {{m|fr|-métrie}}, from Ancient greek (to 1453) {{m|grc|ἄνθρωπος||human}} + {{m|grc|μέτρον||measure}}, influenced by Latin use.\u0026lt;ref\u0026gt;{{R:Online Etymology Dictionary}}\u0026lt;/ref\u0026gt;\u0026lt;ref\u0026gt;{{R:Merriam-Webster Online}}\u0026lt;/ref\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The science of measuring the human body in order to ascertain the average dimensions of the human form at different ages, and in different divisions of race, class, etc\", \"priority\":1}]}, \"synonyms\":{}}");

	add("anthropomorphist", "{\"term\":\"anthropomorphist\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|anthropomorphism|ist|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who anthropomorphizes\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"One who attributes the human form or other human attributes to God\", \"priority\":2}]}, \"synonyms\":{}}");

	add("anthropomorphology", "{\"term\":\"anthropomorphology\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the attribution of human characteristics to God\", \"priority\":1}]}, \"synonyms\":{}}");

	add("anthroponomy", "{\"term\":\"anthroponomy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The science of the laws of the development of the human organism in relation to other organisms and the environment\", \"priority\":1}]}, \"synonyms\":{}}");

	add("anthroponymy", "{\"term\":\"anthroponymy\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"w:English language|English \u0027anthrop-\u0027 (person”, “human) + Ancient greek (to 1453) \u0027ὠνυμία\u0027 (from \u0027ὄνομα\u0027 (name) \u0026lt;ref name\u003d\u0026quot;OED\u0026quot;\u0026gt;“[http://dictionary.oed.com/cgi/entry/50009462 anthroponymy]” listed in the \u0027\u0027Oxford English Dictionary\u0027\u0027 [2\u0026lt;sup\u0026gt;nd\u0026lt;/sup\u0026gt; Ed.; 1989]\u0026lt;/ref\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The study of personal names.\u0026lt;ref name\u003d\u0026quot;OED\u0026quot;/\u0026gt\", \"priority\":1}]}, \"synonyms\":{}}");

	add("anthropopathy", "{\"term\":\"anthropopathy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|anthropo|pathy|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The attribution of human emotions to a god\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"In its recoil from the gross \u0027\u0027anthropopathy\u0027\u0027 of the vulgar notions, it falls into the vacuum of absolute apathy\", \"priority\":2}]}, \"synonyms\":{}}");

	add("anthropophagolagnia", "{\"term\":\"anthropophagolagnia\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The paraphilia of cannibalism preceded by rape\", \"priority\":1}]}, \"synonyms\":{}}");

	add("anthropophobia", "{\"term\":\"anthropophobia\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"{{confix|anthropo|phobia|lang\u003den}}. Both elements are borrowed from Ancient greek (to 1453) \u0027ἄνθρωπος\u0027 (man, human) + \u0027φόβος\u0027 (fear) respectively.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A profound fear of human beings, or of human society\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1880\u0027\u0027, Edward Bliss Foote, \u0027Plain Home Talk about the Human System\u0027, 4th ed., page 438 [http://books.google.com/books?id\u003d3lUGmEf6bR0C\u0026amp;q\u003d%22unlike+anthropophobia%22\u0026amp;pgis\u003d1\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The affection is unlike \u0027\u0027anthropophobia\u0027\u0027, because this is characterized by dislike of men, and decided aversion to sexual intercourse\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1925\u0027\u0027, w:Sinclair Sinclair Lewis, \u0027w:Arrowsmith Arrowsmith\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"It was when \u0027\u0027anthropophobia\u0027\u0027 set in, when he was made uneasy by people who walked too close to him, that, sagely viewing his list and seeing how many phobias were now checked, he permitted himself to rest\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Toshio Kawai, \u0026quot;Postmodern consciousness in the novels of Haruki Murakami,\u0026quot; in \u0027The Cultural Complex: Contemporary Jungian Perspectives on Psyche and Society\u0027 [http://books.google.com/books?id\u003dCECzJNxyfocC], ISBN 1583919139, page 97\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"He was suffering from \u0027\u0027anthropophobia\u0027\u0027, a typical Japanese symptom which shows alienation, and liberation, from the embracing community\", \"priority\":7}]}, \"synonyms\":{}}");

	add("anthropophyte", "{\"term\":\"anthropophyte\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|anthropo|phyte|t1\u003dhuman|t2\u003dplant|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A plant introduced into a new habitat by humans\", \"priority\":1}]}, \"synonyms\":{}}");

	add("anthroposcopy", "{\"term\":\"anthroposcopy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A form of anthropology based upon visual observation of the physical characteristics of the human body\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1970\u0027\u0027 William Herbert Sheldon - Varieties of Human Physique: an introduction to constitutional psycholog\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Only when both \u0027\u0027anthroposcopy\u0027\u0027 and anthropometry brings us to the same result are we satisfied with the outcome\", \"priority\":3}]}, \"synonyms\":{}}");

	add("anthroposemiotics", "{\"term\":\"anthroposemiotics\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|anthropo|semiotics|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The study of human communication\", \"priority\":1}]}, \"synonyms\":{}}");

	add("anthroposophist", "{\"term\":\"anthroposophist\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A proponent of anthroposophy\", \"priority\":1}]}, \"synonyms\":{}}");

	add("anthroposophy", "{\"term\":\"anthroposophy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|anthropo|sophy|lang\u003den}}, from a Renaissance Latin {{m|la|anthroposophia}} (attested in Heinrich Cornelius Agrippa, d. 1535, and Thomas Vaughan, d. 1666), popularized from the 1910s via German {{m|de|Anthroposophie}} (:w:Rudolf Steiner|Rudolf Steiner, 1861–1925).\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Human wisdom; knowledge or understanding of human nature\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A spiritual movement inaugurated by Rudolf Steiner (also capitalized as Anthroposophy), postulating the existence of an objective, intellectually comprehensible spiritual world accessible to direct experience through inner development\", \"priority\":2}]}, \"synonyms\":{}}");

	add("anthropotechnics", "{\"term\":\"anthropotechnics\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|anthropo|technics|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The science and technology concerning the close interaction of man and machines\", \"priority\":1}]}, \"synonyms\":{}}");

	add("anthropotoponym", "{\"term\":\"anthropotoponym\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|anthropo|toponym|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A placename derived from the name or a person\", \"priority\":1}]}, \"synonyms\":{}}");

	add("anthropozoonosis", "{\"term\":\"anthropozoonosis\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|anthropo|zoonosis|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any disease that is transmitted from animals to humans, or vice versa\", \"priority\":1}]}, \"synonyms\":{}}");

	add("anthrozoology", "{\"term\":\"anthrozoology\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|anthro|zoology|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The study of the interactions between humans and animals\", \"priority\":1}]}, \"synonyms\":{}}");

	add("anthurium", "{\"term\":\"anthurium\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{rfe|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of several tropical American evergreen plants, of the genus , grown for their ornamental leaves and spathes\", \"priority\":1}]}, \"synonyms\":{}}");

	add("anthypophora", "{\"term\":\"anthypophora\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{rfe|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A device in which the author poses an opposing argument, then immediately refutes it\", \"priority\":1}]}, \"synonyms\":{}}");

	add("antiabortionism", "{\"term\":\"antiabortionism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"1982\u0027\u0027, Michael J. Gorman, \u0027Abortion \u0026amp; the Early Church: Christian, Jewish \u0026amp; Pagan Attitudes in the Greco-Roman World\u0027, InterVarsity Press (1982), ISBN 9780877843979, page 81\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Opposition to contraception was not derived from \u0027\u0027antiabortionism\u0027\u0027, which reacted to a common practice in surrounding culture, but arose rather in response to problems in the Christian community\", \"priority\":2}]}, \"synonyms\":{}}");

