	add("antidifference", "{\"term\":\"antidifference\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|anti|difference|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A function \u0027F(x)\u0027 is the antidifference of \u0027f(x)\u0027 if \u0027F(x+1)-F(x)\u003df(x\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"If \u0027f(x)\u003db\u0026lt;sup\u0026gt;x\u0026lt;/sup\u0026gt;\u0027 then \u0027F(x)\u003db\u0026lt;sup\u0026gt;x\u0026lt;/sup\u0026gt;/(b-1)+C\u0027 is the general \u0027\u0027antidifference\u0027\u0027 since \u0027F(x+1)-F(x) \u003d [b\u0026lt;sup\u0026gt;x+1\u0026lt;/sup\u0026gt;/(b-1)+C] - [b\u0026lt;sup\u0026gt;x\u0026lt;/sup\u0026gt;/(b-1)+C] \u003d (b\u0026lt;sup\u0026gt;x+1\u0026lt;/sup\u0026gt;-b\u0026lt;sup\u0026gt;x\u0026lt;/sup\u0026gt;)/(b-1) \u003d b\u0026lt;sup\u0026gt;x\u0026lt;/sup\u0026gt; \u003d f(x\", \"priority\":2}]}, \"synonyms\":{}}");

	add("antidiscipline", "{\"term\":\"antidiscipline\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|anti|discipline|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An academic discipline that is the opposite of another, or that goes against the conventions of disciplines generally\", \"priority\":1}]}, \"synonyms\":{}}");

	add("antidisestablishmentarianism", "{\"term\":\"antidisestablishmentarianism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{confix|anti|disestablishmentarian|ism|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A political philosophy opposed to the separation of a religious group (\u0026quot;church\u0026quot;) and a government (\u0026quot;state\u0026quot;), especially the belief held by those in 19th century England opposed to separating the Anglican church from the civil government or to refer to separation of church and state\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1998\u0027\u0027, University of Oklahoma College of Law, \u0027American Indian Law Review\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Jed Rubenfeld, who actually may not have been recycling a \u0027Boerne\u0027 Court- rejected argument into a law review article,\u0026lt;sup\u0026gt;450\u0026lt;/sup\u0026gt; reasoned that RFRA indeed lacked constitutionality, but because of First Amendment \u0027\u0027antidisestablishmentarianism\u0027\u0027, and not the reasons offered by the Court.\u0026lt;sup\u0026gt;451\u0026lt;/sup\u0026gt\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, Angela Hague and David Lavery (credited as editors, but truly authors of the compiled fictional reviews), \u0027Teleparody: predicting/preventing the TV discourse of tomorrow\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The establishmentarianism of Hatch\u0027s alliance-building strategy undermined by the disestablishmentarianism of Wiglesworth\u0027s treachery triggers an \u0027\u0027antidisestablishmentarianism\u0027\u0027 in Hawk \u0026amp;mdash; but the negation of Wiglesworth\u0027s \u0027dis\u0027 coupled with the counter-negation of Hawk\u0027s \u0027anti\u0027 does not simply generate a synthetic affirmation of Hatch\u0027s \u0027establishmentarianism\u0027. Instead, Hawk\u0027s \u0027\u0027antidisestablishmentarianism\u0027\u0027, like a cancerous wart on the end of the nose, is perched at the fuzzy border separating ontology from oncology, malignity from malignancy\", \"priority\":5}]}, \"synonyms\":{}}");

	add("antidiuresis", "{\"term\":\"antidiuresis\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|anti|diuresis|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The control of body water balance by the reduction of urination\", \"priority\":1}]}, \"synonyms\":{}}");

