	add("antidote", "{\"term\":\"antidote\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Latin \u0027antidotum\u0027 from Ancient greek (to 1453) \u0027ἀντίδοτον\u0027 neuter of \u0027ἀντίδοτος\u0027 (given as a remedy for) from \u0027ἀντιδίδωμι\u0027 (i give in return, repay) from \u0027ἀντί\u0027 (against) + \u0027δίδωμι\u0027 (i give) Compare French \u0027antidote\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A remedy to counteract the effects of poison \u0027(often followed by \u0026quot;against,\u0026quot; \u0026quot;for,\u0026quot; or \u0026quot;to\u0026quot\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"She reached the hospital in time to receive the \u0027\u0027antidote\u0027\u0027 for the snake venom\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"date\u003d23 December passage\u003dThe druids believed that mistletoe could make barren animals fecund, and that it was an \u0027\u0027antidote\u0027\u0027 to all poisons\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Something that counteracts or prevents something harmful\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"We need an \u0027\u0027antidote\u0027\u0027 for this misinformation\", \"priority\":5}]}, \"synonyms\":{}}");

