	add("antifashion", "{\"term\":\"antifashion\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|anti|fashion|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any fashion that is intentionally contrary to the mainstream\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1995\u0027\u0027, Toby Fischer-Mirkin, \u0027Dress code: understanding the hidden meanings of women\u0027s clothes\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Antifashion\u0027\u0027 as a means of social defiance goes back to Marie Antoinette, the dandies, the bohemians of Lautrec\u0027s Paris\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Tiantian Zheng, \u0027Red lights: the lives of sex workers in postsocialist China\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Hostesses\u0027 sartorial practice manifests some of the attributes generally associated with the \u0027\u0027antifashion\u0027\u0027 style of punk, hippie, and other subcultures\", \"priority\":5}]}, \"synonyms\":{}}");

