	add("antiflow", "{\"term\":\"antiflow\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|anti|flow|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A mental state of boredom and lack of challenge, associated with performing activities one does not want to do\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1992\u0027\u0027, Mihály Csíkszentmihályi, Isabella Selega Csikszentmihályi, \u0027Optimal experience: psychological studies of flow in consciousness\u0027 (page 135\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A second source of \u0027\u0027antiflow\u0027\u0027 for the blue-collar workers was the type of interaction they had with supervisors\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"flow in an opposite directio\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2001\u0027\u0027, Giovanni C. Bonsignori, \u0027Nucleus-nucleus collisions: proceedings of the conference\u0027 (page 148\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Antiflow\u0027\u0027 of pions can be explained by the shadowing effect\", \"priority\":6}]}, \"synonyms\":{}}");

