	add("antiform", "{\"term\":\"antiform\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|anti|form|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A topographic feature which is composed of sedimentary layers in a convex formation, but may not actually form a real anticline (\u0027i.e.\u0027, the oldest rocks may not be exposed in the middle\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A form that defies the usual conventions of artistic forms\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1983\u0027\u0027, Edith Kurzweil, William Phillips, \u0027Writers and Politics: A Partisan Review Reader\u0027 (page 236\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Dada forms and \u0027\u0027antiforms\u0027\u0027 were used as a means of reacting against Abstract Expressionism and abstract art generally\", \"priority\":4}]}, \"synonyms\":{}}");

