	add("antihistory", "{\"term\":\"antihistory\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|anti|history|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Spurious history\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, w:Alan Alan Dershowitz, \u0027The Case for Israel\u0027, page 213\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Instead, there was the fraudulent manufacturing of false \u0027\u0027antihistory\u0027\u0027. It was the kind of deception for which professors are rightly fire\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Robert C. Williams, \u0027The Historian\u0027s Toolbox\u0027, ISBN 9780765633286, [http://books.google.ca/books?id\u003dYD52HrfEZgAC\u0026amp;printsec\u003dfrontcover\u0026amp;dq\u003d%22The+Historian%27s+Toolbox%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dPMs5U7-KOKjo2QXk0IDICQ\u0026amp;ved\u003d0CC8Q6AEwA\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003dantihistory\u0026amp;f\u003dfalse p. 31 (Google preview\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The most notorious example of \u0027\u0027antihistory\u0027\u0027 is historical denial. Historical denial asserts that a well-known event never really happened or that a well-known person never existed\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A false or fictional narrative describing past events which did not actually occur\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1975\u0027\u0027, Peter Hanns Reill, \u0027The German Enlightenment and the Rise of Historicism\u0027, ISBN 9780520025943, [http://books.google.ca/books?id\u003dE7uyIhUMX00C\u0026amp;pg\u003dPA69\u0026amp;lpg\u003dPA69\u0026amp;dq\u003d%22antihistories%22\u0026amp;source\u003dbl\u0026amp;ots\u003d37CMKAsePc\u0026amp;sig\u003dYf49IsR2AYjyYtIQqv2j4-iPTa8\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dzsU5U5SrLsXs2QXkqYGoDw\u0026amp;ved\u003d0CC0Q6AEwA\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22antihistories%22\u0026amp;f\u003dfalse p. 69 (Google preview\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Rousseau\u0027s \u0027\u0027antihistories\u0027\u0027 paid homage to a time that might have been\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"2001\u0027\u0027, John Kadvany, \u0027Imre Lakatos and the Guises of Reason\u0027, ISBN 9780822380443, [http://books.google.ca/books?id\u003d6Fr17sAdhDIC\u0026amp;pg\u003dPA316\u0026amp;dq\u003d%22antihistories%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dy8k5U97cJa3C2gWu_4C4Aw\u0026amp;ved\u003d0CFIQ6AEwB\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22antihistories%22\u0026amp;f\u003dfalse p. 316 (Google preview\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"W]e are constantly subject to the danger of creating foundations for the antiethics of Stalinism, the antiscience of Lysenko genetics, and the \u0027\u0027antihistories\u0027\u0027 of Muscovite historians\", \"priority\":13}]}, \"synonyms\":{}}");

