	add("antimacassar", "{\"term\":\"antimacassar\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A cover for the back or arms of a chair or sofa, originally to prevent them from being soiled by macassar oil\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"She was particularly fond of animals, and, besides her canary, whose cage hung on a nail in the massive wall of the keep by day, to the great annoyance of prisoners who relished an afterdinner nap, and was shrouded in an \u0027\u0027antimacassar\u0027\u0027 on the parlour table at night, she kept several piebald mice and a restless revolving squirrel\", \"priority\":2}]}, \"synonyms\":{}}");

