	add("antimodernity", "{\"term\":\"antimodernity\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|anti|modernity|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Opposition to modernity\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Tyson E. Lewis, Richard Kahn, \u0027Education Out of Bounds\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The knowledge that Stewart suggests is therefore not simply the remnant of an irrational \u0027\u0027antimodernity\u0027\u0027 (as Horkheimer and Adorno would suggest) nor is it a linear return to an indigenous belief system that is premodern\", \"priority\":3}]}, \"synonyms\":{}}");

	add("antimodernization", "{\"term\":\"antimodernization\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|anti|modernization|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Opposition to modernization\", \"priority\":1}]}, \"synonyms\":{}}");

