	add("antimoniate", "{\"term\":\"antimoniate\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|antimony|ate|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The anion of pentavalent antimony Sb(OH)\u0026lt;sub\u0026gt;4\u0026lt;/sub\u0026gt;\u0026lt;sup\u0026gt;-\u0026lt;/sup\u0026gt; or any salt containing this anion. It is most commonly encountered as a complex in the drug w:Meglumine meglumine antimoniate\", \"priority\":1}]}, \"synonyms\":{}}");

	add("antimonopole", "{\"term\":\"antimonopole\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|anti|monopole|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A monopole of opposite polarity to another\", \"priority\":1}]}, \"synonyms\":{}}");

