	add("antimony", "{\"term\":\"antimony\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\"], \"text\":\"From \u0027antimonium\u0027 attested in the eleventh century; see also w:Antimon. Etymology|here.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A chemical element (\u0027symbol\u0027 Sb) with an atomic number of 51. The symbol is derived from Latin\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The alloy stibnite\", \"priority\":2}]}, \"synonyms\":{}}");

