	add("antimother", "{\"term\":\"antimother\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|anti|mother|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A mother whose behaviour is the opposite of that socially expected of mothers\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1996\u0027\u0027, Eileen L. McDonagh, \u0027Breaking the abortion deadlock: from choice to consent\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The consent-to-pregnancy foundation runs the final risk of portraying women as \u0027\u0027antimothers\u0027\u0027, or monsters who kill their children\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, Heléna Ragoné, France Winddance Twine, \u0027Ideologies and technologies of motherhood: race, class, sexuality, nationalism\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"These representations of \u0027\u0027antimothers\u0027\u0027, monster mothers, \u0026quot;other\u0026quot; mothers can be understood as one facet of a cultural drive to monitor mothers, regulate them\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, Frances H. Early, Kathleen Kennedy, \u0027Athena\u0027s daughters: television\u0027s new women warriors\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"As an extremely pregnant Xena declared at Corinth, \u0026quot;This baby is nothing compared to my empire!\u0026quot; Evil Xena was thus an \u0027\u0027antimother\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Sidney I. Dobrin, Kenneth B. Kidd, \u0027Wild things: children\u0027s culture and ecocriticism\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"As an \u0027\u0027antimother\u0027\u0027, she embodies everything foresworn by Victorian domestic ideology and clearly spells danger to the unwary\", \"priority\":9}]}, \"synonyms\":{}}");

	add("antimuon", "{\"term\":\"antimuon\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|anti|muon|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The antiparticle corresponding to a muon\", \"priority\":1}]}, \"synonyms\":{}}");

	add("antimusic", "{\"term\":\"antimusic\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|anti|music|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any form of music that defies convention to such a degree that some people would not recognise it as musical\", \"priority\":1}]}, \"synonyms\":{}}");

	add("antimuslim", "{\"term\":\"antimuslim\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027 mich, \u0027Danish Peoples Party\u0027 publicly declares themselves \u0026quot;antimuslim\u0026quot; Group: soc.religion.isla\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Christian Thulesen Dahl, co-founder of the far-right party \u0026quot;Danish Peoples Party\u0026quot; - which has a following of 13-15% of the danish population - today declares that the party is now officially antimusli\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1996\u0027\u0027 Serigne Diop, Monitoring antimuslim hate in the media: Let us organize. Group: soc.religion.isla\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"I have known that man to be a virulent antimuslim bigot. He holds a forum on the New York Times web site on International affairs. I have tried to confront him several times\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027 Eris, What do the terrorist want? Group: alt.fan.rush-limbaug\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"They want to cause as many problems as they can so we kill as many innocent people as possible so they can point to us and say look at all of the innocent people the antimuslim people are killing\", \"priority\":6}]}, \"synonyms\":{}}");

	add("antimyth", "{\"term\":\"antimyth\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|anti|myth|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A belief or system that opposes a myth or myths\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1996\u0027\u0027, John R. Maier, \u0027Desert Songs\u0027 (page 86\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"On a deeper level, Stivers believes, there is \u0026quot;an underlying commonality\u0026quot; to myth and ritual of traditional societies and the \u0027\u0027antimyth\u0027\u0027 of modern, technological society\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Howard Schwartz, \u0027Tree of Souls: The Mythology of Judaism\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Indeed, one way of reading this is not as a myth, but as an \u0027\u0027antimyth\u0027\u0027, intended to limit further mythic development\", \"priority\":5}]}, \"synonyms\":{}}");

	add("antinarrative", "{\"term\":\"antinarrative\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|anti|narrative|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A narrative (as of a play or novel) that deliberately avoids the typical conventions of the narrative, such as a coherent plot and resolution\", \"priority\":1}]}, \"synonyms\":{}}");

	add("antinatalism", "{\"term\":\"antinatalism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|anti|natalism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The philosophical position that asserts a negative value judgment towards birth\", \"priority\":1}]}, \"synonyms\":{}}");

	add("antinationalism", "{\"term\":\"antinationalism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|anti|nationalism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"opposition to nationalism\", \"priority\":1}]}, \"synonyms\":{}}");

	add("antinaturalism", "{\"term\":\"antinaturalism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The view that the natural world and the social world are different, related to antipositivism\", \"priority\":1}]}, \"synonyms\":{}}");

