	add("antinomian", "{\"term\":\"antinomian\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From the Ancient greek (to 1453) \u0027ἀντί\u0027 (against) + \u0027νόμος\u0027 (custom, law)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who embraces antinomianism\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1886\u0027\u0027 J. H. Thorpe in \u0026quot;s:Brine, John John Brine\u0026quot; entry in \u0027s:Dictionary of National Dictionary of National Biography\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"quot;He was called by many persons an \u0027\u0027antinomian\u0027\u0027, though his life was exemplary.\u0026quot\", \"priority\":3}]}, \"synonyms\":{}}");

	add("antinomianism", "{\"term\":\"antinomianism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|antinomian|ism|lang\u003den}}, coined by {{w|Martin Luther}}, notably used in his \u0027Against the Antinomians\u0027 (1539).\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A religious movement which believes that only the spiritual \u0027law of Faith\u0027 (Romans 3:27) is essential for salvation; and which is \u0027against\u0027 all other practical \u0027laws\u0027 being taught as being essential for salvation; and referring to them as legalism\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Opposition to the Torah\", \"priority\":2}]}, \"synonyms\":{}}");

	add("antinominalism", "{\"term\":\"antinominalism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|anti|nominalism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A doctrine that is counter to nominalism\", \"priority\":1}]}, \"synonyms\":{}}");

	add("antinomy", "{\"term\":\"antinomy\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027ἀντί\u0027 (against) + \u0027νόμος\u0027 (custom, law) Surface analysis {{confix|anti|nomy|t1\u003dopposite|t2\u003dlaw|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An apparent contradiction between valid conclusions; a paradox\", \"priority\":1}]}, \"synonyms\":{}}");

	add("antinormativity", "{\"term\":\"antinormativity\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|anti|normativity|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Quality of being antinormative\", \"priority\":1}]}, \"synonyms\":{}}");

	add("antinous", "{\"term\":\"antinous\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From the Ancient greek (to 1453) {{m|grc|Ἀντίνοος}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A Bithynian Greek youth and lover of Roman Emperor Hadrian\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A constellation created by the emperor Hadrian, now considered by astronomers to be a part of Aquila\", \"priority\":2}]}, \"synonyms\":{}}");

	add("antinovel", "{\"term\":\"antinovel\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|anti|novel|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A novel that deliberately avoids the typical conventions of the novel, such as a coherent plot and protagonist\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Digressions are usually considered a characteristic feature of the \u0027\u0027antinovel\u0027\u0027 tradition\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Any form of writing style that deviates from the norm of technical conventions used in writing literature\", \"priority\":3}]}, \"synonyms\":{}}");

	add("antinovelist", "{\"term\":\"antinovelist\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|antinovel|ist|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A writer of antinovels\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1995\u0027\u0027, Dennis Porter, \u0027Rousseau\u0027s legacy: emergence and eclipse of the writer in France\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The difference between a modern novelist like Roth and an eighteenth-century moralist and \u0027\u0027antinovelist\u0027\u0027 like Rousseau\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1997\u0027\u0027, Margaret Anne Doody, \u0027The True Story of the Novel\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"But for Augustine, as for the harsher Puritans who followed him, there is no real point in saying what some humanist \u0027\u0027antinovelists\u0027\u0027 very much wished to say\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, Roger Shattuck, \u0027Candor and perversion: literature, education, and the arts\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"At no point in her writing does Mary Lee Settle become an \u0027\u0027antinovelist\u0027\u0027 or a player of literary games\", \"priority\":7}]}, \"synonyms\":{}}");

	add("antinuclearism", "{\"term\":\"antinuclearism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|antinuclear|ism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Opposition to nuclear weapons\", \"priority\":1}]}, \"synonyms\":{}}");

	add("antinuclearist", "{\"term\":\"antinuclearist\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|antinuclear|ist|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who is opposed to nuclear weapons\", \"priority\":1}]}, \"synonyms\":{}}");

	add("antinucleon", "{\"term\":\"antinucleon\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|anti|nucleon|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The antiparticle of a nucleon\", \"priority\":1}]}, \"synonyms\":{}}");

	add("antinucleus", "{\"term\":\"antinucleus\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|anti|nucleus|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The nucleus of an antiatom\", \"priority\":1}]}, \"synonyms\":{}}");

	add("antinutrient", "{\"term\":\"antinutrient\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|anti|nutrient|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any substance that interferes with the absorption or metabolism of a nutrient\", \"priority\":1}]}, \"synonyms\":{}}");

	add("antioch", "{\"term\":\"antioch\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027ἀντιόχεια\u0027 () from \u0027ἀντίοχος\u0027 This was the given name of the Macedonian father of {{w|Seleucus I Nicator}}, the founder of the {{w|Seleucid Empire}}. Subsequently the name was borne by various kings of Seleucid dynasty and numerous cities in their domain are named after these personages. Compare also Laodicea, Apamea and Seleucia.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the name of a number of cities founded by kings of the Seleucid dynasty, the most famous being \u0026quot;Antioch on the Orontes\u0026quot; in ancient Syria (modern day Antakya in south-eastern Turkey\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1982\u0027\u0027, Volume 2, Issues 1-4‎, [http://www.iranica.com/articles/antioch-1-northern-syria Page 120\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"During his frequent stays at \u0027\u0027Antioch\u0027\u0027, Tigranes [king of Armenia], a self-styled king of kings, maintained a sumptuous court with a ceremonial of Achaemenid origin that Plutarch has described\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A city in California\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A village in Illinois\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A ghost town in Nebraska\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A village in Ohio\", \"priority\":7}]}, \"synonyms\":{}}");

	add("antioncogene", "{\"term\":\"antioncogene\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{prefix|anti|oncogene|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any gene that suppresses the formation of tumours\", \"priority\":1}]}, \"synonyms\":{}}");

	add("antiope", "{\"term\":\"antiope\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An Amazon, daughter of Ares and sister to Melanippe and Hippolyte, (and possibly Orithyia), queens of the Amazons,. She was the wife of Theseus, and the only Amazon known to have married\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The daughter of the Boeotian river god Asopus, according to Homer\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Short for , a main belt asteroid\", \"priority\":3}]}, \"synonyms\":{}}");

	add("antiopera", "{\"term\":\"antiopera\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|anti|opera|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An opera (dramatical production) that deliberately avoids the typical conventions of the opera\", \"priority\":1}]}, \"synonyms\":{}}");

	add("antioxidation", "{\"term\":\"antioxidation\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|anti|oxidation|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The action of an antioxidant\", \"priority\":1}]}, \"synonyms\":{}}");

	add("antipapist", "{\"term\":\"antipapist\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|anti|papist|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who subscribes to antipapism\", \"priority\":1}]}, \"synonyms\":{}}");

	add("antiparallelogram", "{\"term\":\"antiparallelogram\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|anti|parallelogram|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A quadrilateral in which the pairs of nonadjacent sides are congruent, but in which two opposite sides intersect and are therefore not parallel\", \"priority\":1}]}, \"synonyms\":{}}");

	add("antiparticle", "{\"term\":\"antiparticle\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|anti|particle|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A subatomic particle corresponding to another particle with the same mass, spin and mean lifetime but with charge, parity, strangeness and other quantum numbers flipped in sign\", \"priority\":1}]}, \"synonyms\":{}}");

	add("antipartyism", "{\"term\":\"antipartyism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|anti|partyism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"opposition to a party or faction\", \"priority\":1}]}, \"synonyms\":{}}");

	add("antipasto", "{\"term\":\"antipasto\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Italian\"], \"text\":\"From Italian \u0027antipasto|lang\u003dit\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"an Italian starter for a meal; normally a cold assortment of salami, cheese, seafood and vegetables\", \"priority\":1}]}, \"synonyms\":{}}");

	add("antipathy", "{\"term\":\"antipathy\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027lang\u003dgrc\u0027 noun of state from \u0027lang\u003dgrc|ἀντιπαθής\u0027 () from \u0027lang\u003dgrc|ἀντί\u0027 () + root of \u0027lang\u003dgrc|πάθος\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Contrariety or opposition in feeling; settled aversion or dislike; repugnance; distaste\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Inveterate antipathies against particular nations, and passionate attachments to others, are to be avoided. --Washington\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Natural contrariety; incompatibility; repugnancy of qualities; as, oil and water have antipathy\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A habit is generated of thinking that a natural antipathy exists between hope and reason. --I. Taylor\", \"priority\":4}]}, \"synonyms\":{}}");

	add("antipatriot", "{\"term\":\"antipatriot\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|anti|patriot|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who shuns or opposes patriotism; an unpatriotic person\", \"priority\":1}]}, \"synonyms\":{}}");

