	add("antiphon", "{\"term\":\"antiphon\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"ancient greek (to 1453)\"], \"text\":\"From French \u0027antiphone\u0027 or {{m|la|antiphōna}}, from Ancient greek (to 1453) \u0027ἀντίφωνα\u0027 (responses, musical accords) neuter plural substantive of \u0027ἀντίφωνος\u0027 (concordant) from \u0027ἀντί\u0027 (in return) + \u0027φωνή\u0027 (sound) Compare \u0027anthem\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A devotional piece of music sung responsively\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A response or reply\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Barbara Everett, ‘Making and Breaking in Shakespeare\u0027s Romances’, in the \u0027London Review of Books\u0027 29:6, page 20\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The Clown says: ‘And so we wept; and there was the first gentleman-like tears that ever we shed’; to which his father, the Shepherd, adds the comfortable \u0027\u0027antiphon\u0027\u0027, ‘We may live, son, to shed many more.’\", \"priority\":4}]}, \"synonyms\":{}}");

