	add("antipodes", "{\"term\":\"antipodes\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Latin from Ancient greek (to 1453) \u0027ἀντίποδες\u0027 from \u0027ἀντί\u0027 (opposite) + \u0027πόδες\u0027 plural of \u0027πούς\u0027 (foot)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The place on the diametrically opposite side of the earth from a given point\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The Southern Hemisphere\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"a delighted shout from the children swung him toward the door again. His sister, Mrs. Gerard, stood there in carriage gown and sables, radiant with surprise. \u0026amp;para; \u0026quot;Phil!\u0026amp;nbsp; \u0027You!\u0027\u0026amp;nbsp; Exactly like you, Philip, to come strolling in from the \u0027\u0027antipodes\u0027\u0027\u0026amp;mdash;dear fellow!\u0026quot; recovering from the fraternal embrace and holding both lapels of his coat in her gloved hands\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Australia and New Zealand\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The opposite of something\", \"priority\":5}]}, \"synonyms\":{}}");

