	add("antipodism", "{\"term\":\"antipodism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{borrowing|fr|antipodisme|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A form of foot juggling where the juggler lies on his or her back, usually on a sort of chair\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The relation between points on a sphere which are directly opposite each other; or the function which maps a point to its opposite point\", \"priority\":2}]}, \"synonyms\":{}}");

