	add("antipolitics", "{\"term\":\"antipolitics\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|anti|politics|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Political activity outside of the mainstream political establishment\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, Daphne Berdahl, Matti Bunzl, Martha Lampland, \u0027Altering states\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Antipolitics\u0027\u0027 is a form of intellectual resistanc\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Peter Alexander Meyers, \u0027Civic war and the corruption of the citizen\u0027 (page 141\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Now, cultural reaction against this development may have taken various forms: a boisterous \u0027\u0027antipolitics\u0027\u0027 in which everyone rails against “usurpers in Washington,”\", \"priority\":5}]}, \"synonyms\":{}}");

	add("antipollution", "{\"term\":\"antipollution\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"* {{prefix|anti|pollution|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any way, shape, or form which directly or indirectly helps the environment or reduces pollution\", \"priority\":1}]}, \"synonyms\":{}}");

	add("antipope", "{\"term\":\"antipope\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027antipape\u0027 (later assimilated to {{prefix|anti|pope|lang\u003den}}), from {{m|la|antipāpa}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person who claims or claimed to be the pope as the result of a disputed election, but is not considered by the Roman Catholic Church to be the real pope\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Edwin Mullins, \u0027The Popes of Avignon\u0027, Blue Bridge 2008, p. 59\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Meanwhile support for the ‘puppet’ \u0027\u0027antipope\u0027\u0027 Nicholas V, deprived of his protector and by now excommunicated along with his emperor, rapidly withered away\", \"priority\":3}]}, \"synonyms\":{}}");

	add("antipositivism", "{\"term\":\"antipositivism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|anti|positivism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The view that the social realm may not be subject to the same methods of investigation as the natural world\", \"priority\":1}]}, \"synonyms\":{}}");

	add("antiprism", "{\"term\":\"antiprism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|anti|prism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A polyhedron composed of two parallel copies of some particular polygon, connected by an alternating band of triangles\", \"priority\":1}]}, \"synonyms\":{}}");

	add("antiprogestin", "{\"term\":\"antiprogestin\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|anti|progestin|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any substance that prevents cells from making or using progesterone\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Antiprogestins\u0027\u0027 may stop some cancer cells from growing and they are being studied in the treatment of breast cancer\", \"priority\":2}]}, \"synonyms\":{}}");

