	add("antiprotease", "{\"term\":\"antiprotease\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{prefix|anti|protease|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Anything that inhibits the action of a protease\", \"priority\":1}]}, \"synonyms\":{}}");

	add("antiprotectionism", "{\"term\":\"antiprotectionism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|anti|protectionism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Opposition to protectionism\", \"priority\":1}]}, \"synonyms\":{}}");

	add("antiproteinase", "{\"term\":\"antiproteinase\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{prefix|anti|proteinase|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any inhibitor of proteinase activity\", \"priority\":1}]}, \"synonyms\":{}}");

	add("antiproton", "{\"term\":\"antiproton\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|anti|proton|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The antiparticle of the proton, having a negative electric charge\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"title\u003dA Palette of volume\u003d100|issue\u003d2|page\u003d146|magazine\u003d|url\u003dhttp://www.americanscientist.org/issues/feature/2012/2/a-palette-of-particles|passage\u003dThere were also particles no one had predicted that just appeared. Five of them [\u0026amp;hellip;, i]n order of increasing modernity, [\u0026amp;hellip;] are the neutrino, the pi meson, the \u0027\u0027antiproton\u0027\u0027, the quark and the Higgs boson\", \"priority\":2}]}, \"synonyms\":{}}");

	add("antiproverb", "{\"term\":\"antiproverb\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|anti|proverb|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A proverb that contradicts anothe\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A humorous adaptation of one or more existing proverbs\", \"priority\":2}]}, \"synonyms\":{}}");

	add("antipsychiatry", "{\"term\":\"antipsychiatry\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A form of psychoanalysis based on existentialist and sociological concepts\", \"priority\":1}]}, \"synonyms\":{}}");

	add("antipyresis", "{\"term\":\"antipyresis\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|anti|pyresis|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The reduction of fever\", \"priority\":1}]}, \"synonyms\":{}}");

	add("antiquark", "{\"term\":\"antiquark\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|anti|quark|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the antiparticle of a quark\", \"priority\":1}]}, \"synonyms\":{}}");

	add("antiquedom", "{\"term\":\"antiquedom\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|antique|dom|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The world of antiques or of things old; antiquity\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1915\u0027\u0027, Life\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The exotic atmosphere of the whole queer underworld of \u0027\u0027antiquedom\u0027\u0027 and of collector-cranks spicily pervades the hook. Yet this, after all, is but the sauce of the dish. The viand itself is the exasperating yet lovable humanness of humanity\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1935\u0027\u0027, The Magazine Antiques\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"To such folk as qualify in the class of small collectors I recommend excursions into the obscure bypaths of \u0027\u0027antiquedom\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1980\u0027\u0027, Ernie Pyle, \u0027Images of Brown County\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"He really doesn\u0027t care much aboutthe furniture in his house. It is not the possession of antiques that fascinates him, but the routing out, the discovering, the acquiring. And every now and then he branches off into some other form of \u0027\u0027antiquedom\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1990\u0027\u0027, John Carmody, \u0027Roman Catholicism: An Introduction\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Without them, Christianity could not be, Catholicism would shrivel into \u0027\u0027antiquedom\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"1998\u0027\u0027, Leonard I. Sweet, \u002711 Genetic Gateways to Spiritual Awakening\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Why is a watch that does nothing but keep time an endangered species, doomed to \u0027\u0027antiquedom\u0027\u0027? Why is the Dick Tracy watch already here\", \"priority\":11}]}, \"synonyms\":{}}");

	add("antiquehood", "{\"term\":\"antiquehood\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|antique|hood|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state, condition, or quality of being an antique or of being old; antiquity\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1972\u0027\u0027, Leona G. Rubin, \u0027How to defend yourself at auctions\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"there will be good reproductions (some of the reproductions themselves are over 100 years old, and even current ones will some day enjoy their own \u0027\u0027antiquehood\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1990\u0027\u0027, Jonathan Gash, \u0027Moonspender: A Lovejoy Novel of Suspense\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"I searched my area of the Eastern Hundreds for clues, landmarks, anything of significance, and drew a circle with my school compass, a derelict brass pivot aspiring to \u0027\u0027antiquehood\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Adam Thomas, \u0027Digital Disciple: Real Christianity in a Virtual World\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Alas, after comparing the current list with the list for my college class of 2005, I seem to be approaching \u0027\u0027antique-hood\u0027\u0027—\", \"priority\":7}]}, \"synonyms\":{}}");

	add("antiquist", "{\"term\":\"antiquist\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|antique|ist|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An antiquary; a collector of antiques\", \"priority\":1}]}, \"synonyms\":{}}");

	add("antiquity", "{\"term\":\"antiquity\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Middle english (1100-1500) \u0027antiquytee\u0027 from Old french (842-ca. 1400) \u0027antiquité\u0027 from Latin \u0027antiquitas\u0027 from \u0027antiquus\u0027 see antique, antic. Compare with French \u0027antiquité\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Ancient times; former ages; times long since past\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The ancients; the people of ancient times\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"That such pillars were raised by Seth all \u0027\u0027antiquity\u0027\u0027 has avowed.\u0027 \u0026amp;mdash;Sir W. Raleigh\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"An old gentleman\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"You are a shrewd \u0027\u0027antiquity\u0027\u0027, neighbor Clench.\u0027 \u0026amp;mdash;B. Jonson\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The historical period preceding the Middle Ages (c. 500-1500), primarily relating to European history\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A relic or monument of ancient times; as, a coin, a statue, etc.; an ancient institution\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"State of being ancient or of ancient lineage\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://openlibrary.org/works/OL1097634W The Mirror and the passage\u003dHe was thinking; but the glory of the song, the swell from the great organ, the clustered lights, […], the height and vastness of this noble fane, its \u0027\u0027antiquity\u0027\u0027 and its strength—all these things seemed to have their part as causes of the thrilling emotion that accompanied his thoughts\", \"priority\":9}]}, \"synonyms\":{}}");

	add("antirationalism", "{\"term\":\"antirationalism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The philosophical position that opposes rationalism\", \"priority\":1}]}, \"synonyms\":{}}");

	add("antirationality", "{\"term\":\"antirationality\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The quality of being antirational\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1995\u0027\u0027, Arthur Roy Eckardt, \u0027How to tell God from the Devil: on the way to comedy\u0027 (page 4\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"To \u0026quot;go beyond\u0026quot; theoretical/speculative reason is not to fall into irrationality or \u0027\u0027antirationality\", \"priority\":3}]}, \"synonyms\":{}}");

