	add("antiwater", "{\"term\":\"antiwater\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|anti|water|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A hypothetical substance resembling water but made from antimatter\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1979\u0027\u0027, William Darrach Halsey, \u0027Merit students encyclopedia: Volume 2\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Thus \u0027\u0027antiwater\u0027\u0027 would boil and freeze at the same temperatures as ordinary water\", \"priority\":3}]}, \"synonyms\":{}}");

	add("antiwisdom", "{\"term\":\"antiwisdom\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|anti|wisdom|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"That which is not, or opposes, wisdom; folly\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Timothy R. Carmody, \u0027Reading the Bible: A Study Guide\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Folly, like Wisdom, speaks in proverbs, but her proverbs are \u0027\u0027antiwisdom\u0027\u0027: \u0026quot;Stolen water is sweet.\u0026quot\", \"priority\":3}]}, \"synonyms\":{}}");

	add("antiworld", "{\"term\":\"antiworld\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|anti|world|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A hypothetical world constructed from antimatter\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1975\u0027\u0027, \u0027Sputnik\u0027 (issue 7\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"But possibly there is an \u0027\u0027antiworld\u0027\u0027 in which, in addition to matter, time is also negative. In such an antiworld man would grow younger with time and a broken glass would come together from its fragments\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1982\u0027\u0027, Rudolʹf Konstantinovich Balandin, \u0027Vladimir Vernadsky\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"It follows that somewhere \u0027\u0027antiworlds\u0027\u0027 consisting of antiparticles are bound to wander. No traces of these antiworlds have as yet been found\", \"priority\":5}]}, \"synonyms\":{}}");

