	add("antler", "{\"term\":\"antler\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Middle english (1100-1500) \u0027auntelere\u0027 \u0027hauntelere\u0027 from Old french (842-ca. 1400) \u0027antoillier\u0027 (antler, horn) of unknown origin. The attempted explanation deriving from an unattested Latin *\u0027\u0027 ((rarum) ante ocularis) seems doubtful, as no other Romance language has a similar word of such formation.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A branching and bony structure on the head of deer, moose and elk, normally in pairs. They are grown and shed each year. (Compare with horn, which is generally not shed\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"While hiking in the woods, I found an \u0027\u0027antler\u0027\u0027 from a deer\", \"priority\":2}]}, \"synonyms\":{}}");

	add("antlerite", "{\"term\":\"antlerite\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\u0027Antler\u0027 mine in Arizona, USA {{suffix||ite|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A greenish hydrous copper sulfate mineral\", \"priority\":1}]}, \"synonyms\":{}}");

	add("antoeci", "{\"term\":\"antoeci\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From the Latin \u0027antoecī\u0027 from the Ancient greek (to 1453) \u0027ἄντοικοι\u0027 (dwellers opposite) from \u0027ἀντί\u0027 (opposite) + \u0027οἶκος\u0027 (dwelling)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The inhabitants at two points on the globe that share a longitude and for which the sum of their degrees of latitude equals zero\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1622\u0027\u0027, w:Peter Peter Heylin, \u0027Cosmographie in Four Bookes, Containing the Chorographie and Historie of the Whole World\u0027, introduction, page 20, column 1 (published in 1674\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Antœci\u0027\u0027 are such as dwell under the same Meridian and the same Latitude or Parallel equally distant from the Æquator; the one northward, the other Southward; the days in both places being of a length; but the Summer of the one being the others winter\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1684\u0027\u0027, w:Thomas Thomas Burnet, \u0027The Theory of the Earth\u0027, [http://books.google.co.uk/books?id\u003dpt33OCWIB6EC\u0026amp;pg\u003dRA1-PA174\u0026amp;dq\u003d%22comprehend+both+the+antipodes%22\u0026amp;lr\u003d\u0026amp;num\u003d100\u0026amp;as_brr\u003d0\u0026amp;ei\u003dQpcNTL76OI_aygTc4vS9AQ\u0026amp;cd\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22comprehend%20both%20the%20antipodes%22\u0026amp;f\u003dfalse book 2, page 174] (1697 edition\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Antichthones\u0027…comprehend both the \u0027Antipodes\u0027 and \u0027\u0027\u0027Antœci\u0027\u0027\u0027, or all beyond the Line\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1796\u0027\u0027, w:Charles Charles Hutton, \u0027[http://archimedes.mpiwg-berlin.mpg.de/cgi-bin/toc/toc.cgi?step\u003dthumb\u0026amp;dir\u003dhutto_dicti_078_en_1795 A Mathematical and Philosophical Dictionary]\u0027, volume 1, page 121, column\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Antœci\u0027\u0027…have their noon, or midnight, or any other hour at the same time; but their seasons are contrary, being spring to the one, when it is autumn with the other\", \"priority\":8}]}, \"synonyms\":{}}");

