	add("antonomasia", "{\"term\":\"antonomasia\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Latin {{m|la|antonomasia}}, Ancient greek (to 1453) {{m|grc|ἀντονομασία||antonomasia|sc\u003dpolytonic}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The substitution of an epithet or title in place of a proper nou\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Use of a proper name to suggest its most obvious quality or aspect\", \"priority\":2}]}, \"synonyms\":{}}");

	add("antony", "{\"term\":\"antony\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a mostly British spelling variant of Anthony\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1607\u0027\u0027 William Shakespeare: \u0027Antony and Cleopatra: Act I, Scene I\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Demetrius\u0027. Is Caesar with Antonius priz\u0027d so slight\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Philo\u0027. Sir, sometimes, when he\u0027s not \u0027\u0027Antony\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"He comes too short of that great propert\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Which still should go with \u0027\u0027Antony\", \"priority\":6}]}, \"synonyms\":{}}");

	add("antonym", "{\"term\":\"antonym\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"circa 1870: {{confix|ant|onym|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A word which has the opposite meaning of another, although not necessarily in all its senses\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"quot;rich\u0026quot; is an \u0027\u0027antonym\u0027\u0027 of \u0026quot;poor\u0026quot;; \u0026quot;full\u0026quot; is an \u0027\u0027antonym\u0027\u0027 of \u0026quot;empty\u0026quot\", \"priority\":2}]}, \"synonyms\":{}}");

	add("antozonite", "{\"term\":\"antozonite\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A radioactive variety of fluorite, containing traces of elemental fluorine gas\", \"priority\":1}]}, \"synonyms\":{}}");

	add("antre", "{\"term\":\"antre\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) from Latin \u0027antrum\u0027 from Ancient greek (to 1453) \u0027ἄντρον\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Cavern; cave\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1818\u0027\u0027, w:John John Keats, \u0027s:Endymion Endymion\u0027, Book II\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Aye, millions sparkled on a vein of gold, / Along whose track the prince quick footsteps told, / With all its lines abrupt and angular: / Out-shooting sometimes, like a meteor-star, / Through a vast \u0027\u0027antre\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1879\u0027\u0027, w:George George Meredith, \u0027s:The Egoist/Chapter The Egoist\u0027, Chapter XXIII: Treats of the Union of Temper and Policy\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Seeing him as she did, she turned from him and shunned his house as the \u0027\u0027antre\u0027\u0027 of an ogre\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1888\u0027\u0027, w:Richard Francis Richard Francis Burton, \u0027s:The Book of the Thousand Nights and a Night/Volume The Book of the Thousand Nights and a Night\u0027, Volume 16\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Hereat quoth he to himself, \u0026quot;If I enter this \u0027\u0027antre\u0027\u0027, haply shall I lose myself, and perish of hunger and thirst!\u0026quot\", \"priority\":7}]}, \"synonyms\":{}}");

	add("antrum", "{\"term\":\"antrum\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Latin \u0027antrum\u0027 from Ancient greek (to 1453) \u0027ἄντρον\u0027 (cave)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A bodily cavity, especially one having bony walls, especially one in the sinuses\", \"priority\":1}]}, \"synonyms\":{}}");

	add("antshrike", "{\"term\":\"antshrike\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|ant|shrike|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Several passerine bird species of various genera in the antbird (Thamnophilidae) family\", \"priority\":1}]}, \"synonyms\":{}}");

	add("antsiness", "{\"term\":\"antsiness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|antsy|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state or quality of being ants\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"was reflected across the capital, as the cram of people sparked warmth rather than \u0027\u0027antsiness\", \"priority\":2}]}, \"synonyms\":{}}");

	add("antumbra", "{\"term\":\"antumbra\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|ante|umbra|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The region from which an occulting body appears entirely contained within the disc of the light source\", \"priority\":1}]}, \"synonyms\":{}}");

